//   localStorage.removeItem('token')
//   history.replace('/')
// }

  return (

    <div>
       <Navbar
          backgroundColor="#3949ab"
          textColor="white"
        >
          <NavlinksList>
    <Router>
      <Navlink text="Home" Link to="/home"/>
      <Navlink text="Add" Link to="/add"/>
        <Link to="/">Login</Link>
        {/* <Link onClick={onLogOut}>Logout</Link> */}
        <Switch>
        <Route exact path="/login">
            <UserForm />
          </Route>
          {/* {loggedIn && <Route */}
          <Route exact path="/add">
            <AddTimeForm />
          </Route>
          <Route exact path="/timesheet/edit/:id" >
            <TimeFormEdit />
          </Route>
          <Route exact path="/">
            <UserForm />
          </Route>
          <Route exact path="/home">
            <h1>Current Timesheets</h1>
           <List /> 
          </Route>
        </Switch>
    </Router>
    </NavlinksList>
    </Navbar>
    </div>
  );
};
